icon2 = PhotoImage(data=icon2_data)
root.iconphoto(False, icon2)

canvas = tk.Canvas(root, width=500, height=500)
canvas.pack(fill='both', expand=True)

emoji = canvas.create_image(250, 250, image=icon)

bouncing_mode = False
velocity_x, velocity_y = 2, 2
speed = 0.04
target_x, target_y = 250, 250  # emoji starts in the center


def change_mode(event):
    global bouncing_mode
    bouncing_mode = not bouncing_mode
    print("bounce" if bouncing_mode else "follow")


def motion(event):
    global target_x, target_y
    target_x = event.x
    target_y = event.y


def move_or_bounce():
    global target_x, target_y, velocity_x, velocity_y
    width = canvas.winfo_width()
    height = canvas.winfo_height()

    # get curr position of the emoji
    current_coords = canvas.coords(emoji)
    if current_coords:
        current_x, current_y = current_coords

        if bouncing_mode:
            new_x = current_x + velocity_x
            new_y = current_y + velocity_y

            # wall collision checks
            if new_x < 0 or new_x > width:
                velocity_x = -velocity_x * random.uniform(0.9, 1.1)
            if new_y < 0 or new_y > height:
                velocity_y = -velocity_y * random.uniform(0.9, 1.1)
        else:
            new_x = current_x + (target_x - current_x) * speed
            new_y = current_y + (target_y - current_y) * speed

        # update emoji's position
        canvas.coords(emoji, new_x, new_y)

    root.after(10, move_or_bounce)


instruction = Label(canvas, text="Click on emoji to toggle mode")
instruction.pack(side=TOP, pady=10)

canvas.bind('<Motion>', motion)
canvas.tag_bind(emoji, '<Button-1>', change_mode)

move_or_bounce()
root.mainloop()
